// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;

import "./CommitReveal.sol";
import "./Convert.sol";

contract RPS {
    CommitReveal public commitRevealContract;
    Convert public convertContract;
    uint public numPlayer = 0;
    uint public reward = 0;
    mapping(address => bool) public playerNotPlayed;
    mapping(address => uint) public revealedChoices;
    mapping(address => bytes32) public committedHashes;
    address[] public players;
    uint public numInput = 0;

    address[4] public allowedPlayers = [
        0x5B38Da6a701c568545dCfcB03FcB875f56beddC4,
        0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2,
        0x4B20993Bc481177ec7E8f571ceCaE8A9e22C02db,
        0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB
    ];

    constructor(address _commitRevealAddress, address _convertAddress) {
        require(_commitRevealAddress != address(0), "Invalid CommitReveal address");
        require(_convertAddress != address(0), "Invalid Convert address");

        commitRevealContract = CommitReveal(_commitRevealAddress);
        convertContract = Convert(_convertAddress);
    }


    modifier onlyAllowedPlayers() {
        bool isAllowed = false;
        for (uint i = 0; i < allowedPlayers.length; i++) {
            if (msg.sender == allowedPlayers[i]) {
                isAllowed = true;
                break;
            }
        }
        require(isAllowed, "Not an allowed player");
        _;
    }

    function addPlayer() public payable onlyAllowedPlayers {
        require(numPlayer < 2, "Game is full");
        if (numPlayer > 0) {
            require(msg.sender != players[0], "Already joined");
        }
        require(msg.value == 1 ether, "Must send 1 ETH to join");
        reward += msg.value;
        playerNotPlayed[msg.sender] = true;
        players.push(msg.sender);
        numPlayer++;
    }

    function commitChoice(uint choice, bytes32 randomBytes) public onlyAllowedPlayers {
        require(numPlayer == 2, "Not enough players");
        require(playerNotPlayed[msg.sender], "Already committed");
        require(choice <= 4, "Invalid choice");

        bytes32 convertedChoice = convertContract.convert(choice, randomBytes);
        bytes32 commitHash = keccak256(abi.encodePacked(randomBytes, convertedChoice));

        committedHashes[msg.sender] = commitHash;
        commitRevealContract.commit(commitHash);

        playerNotPlayed[msg.sender] = false;
    }

    function revealChoice(uint choice, bytes32 randomBytes) public onlyAllowedPlayers {
        require(numPlayer == 2, "Not enough players");
        require(!playerNotPlayed[msg.sender], "Must commit first");
        require(choice <= 4, "Invalid choice");

        bytes32 convertedChoice = convertContract.convert(choice, randomBytes);
        bytes32 revealHash = keccak256(abi.encodePacked(randomBytes, convertedChoice));

        require(revealHash == committedHashes[msg.sender], "Invalid reveal");

        commitRevealContract.reveal(revealHash);

        revealedChoices[msg.sender] = choice;
        numInput++;

        if (numInput == 2) {
            _checkWinnerAndPay();
        }
    }

    function _checkWinnerAndPay() private {
        uint p0Choice = revealedChoices[players[0]];
        uint p1Choice = revealedChoices[players[1]];
        address payable account0 = payable(players[0]);
        address payable account1 = payable(players[1]);

        if ((p0Choice + 1) % 5 == p1Choice || (p0Choice + 3) % 5 == p1Choice) {
            account1.transfer(reward);
        } else if ((p1Choice + 1) % 5 == p0Choice || (p1Choice + 3) % 5 == p0Choice) {
            account0.transfer(reward);
        } else {
            account0.transfer(reward / 2);
            account1.transfer(reward / 2);
        }

        delete players;
        numPlayer = 0;
        numInput = 0;
        reward = 0;
    }
}

